import ExpenseItem from "./components/ExpenseItem";

function App() {
  const movies = [
    {
      id: "m1",
      title: "La ligne verte",
      genre: "Film dramatique",
      date: new Date(2000, 2, 1),
    },
    {
      id: "m2",
      title: "Blues brothers",
      genre: "Comédie",
      date: new Date(1980, 10, 7),
    },
    {
      id: "m3",
      title: "Une nuit en enfer",
      genre: "Horreur",
      date: new Date(1996, 5, 26),
    },
    {
      id: "m4",
      title: "Mad Max 2",
      genre: "Action",
      date: new Date(1982, 7, 11),
    },
    {
      id: "m5",
      title: "Bohemian Rhapsody",
      genre: "Film dramatique",
      date: new Date(2018, 9, 24),
    },
    {
      id: "m6",
      title: "Scarface",
      genre: "Film de gangster",
      date: new Date(1984, 2, 7),
    },
    {
      id: "m7",
      title: "Doom",
      genre: "Horreur",
      date: new Date(1993, 11, 10),
    },
    {
      id: "m8",
      title: "Pirates des caraibes: La malédiction du Black Pearl",
      genre: "Action",
      date: new Date(2003, 7, 13),
      imageUrl:
        "https://fr.web.img4.acsta.net/medias/nmedia/18/35/07/46/affiche2.jpg",
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      {movies.map((expense) => {
        return (
          <div key={expense.id}>
            <ExpenseItem
              date={expense.date}
              title={expense.title}
              amount={expense.amount}
            ></ExpenseItem>
          </div>
        );
      })}
    </div>
  );
}

export default App;
